import React from 'react';
import stylesheet from './Post.module.css'

let Post = (props) => {

    return (
        <div className={stylesheet.Post}>
            <div>
                {props.text}
            </div>
            <br />
            <div>
                <p>Likes:</p>
            </div>
        </div>
    )
}
